import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Navbar from './Component/Navbar/Navbar';
import Menu from './Pages/HomePage/Menu';
import Login from './Pages/LoginAndRegister/Login';
import Register from './Pages/LoginAndRegister/Register';
import ProductPage from './Pages/ProductPage/ProductPage';
import SearchResult from './Pages/SearchedResultPage/SearchResult';
import Account from './Pages/Profile/Profile';
import Chat from './Pages/Profile/Chat/Chat';
import NotFound from './Pages/NotFound';
import NewAnnonce from './Pages/NewAnnonce/NewAnnonce';
import Favorites from './Pages/Profile/Favorites/Favorites';
import MyAnnonces from './Pages/Profile/MyAnnonces/MyAnnonces';
import Profile from './Pages/Profile/Profile/Profile.js';
import Spinner from './Component/Spinner/Spinner';
import loginNavbar from './loginNavbar';

class App extends Component {

  render() {
    return (
     <Router>
       <Switch>
        <div></div><loginNavbar></loginNavbar>
         <Route exact path='/login' component={Login}/>
         <Route exact path="/register" component={Register}></Route>
          <Route>
            <div style={{marginBottom: 100}}>
              <Navbar></Navbar>
            </div>
            <Switch>
              <Route exact path='/' component={Menu}/>
              <Route path='/profil' component={Account}/>
              <Route path='/meldinger' component={Chat}/>
              <Route path='/favoritter' component={Favorites}/>
              <Route path='/mine-annonser' component={MyAnnonces}/>
              <Route path='/nyannonse' component={NewAnnonce}/>
              <Route path='/profile' component={Profile}/>
              <Route  path='/search' component={SearchResult}/>
              <Route  path='/spinner' component={Spinner}/>
              <Route path={'/produkt/:annonceId'} component={ProductPage}/>
              <Route path="*" component={NotFound}/>
            </Switch>            
          </Route>
       </Switch>
     </Router>
    );
  }
}

export default App;
